import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import HistoryView from '../views/HistoryView.vue'
import TraditionalView from '../views/TraditionalView.vue'
import TraditionalDetail from '../views/TraditionalDetail.vue'
import TempleView from '../views/TempleView.vue'
