import NaturalDetail from '@/views/NaturalDetail.vue'
import NaturalDetail from '@/views/NaturalDetail.vue'
// import ProductDetail from '../views/ProductDetail.vue'

const router = createRouter({
  history: createWebHistory(import.meta.env.BASE_URL),
  routes: [
    {
      path: '/',
      name: 'home',
      component: HomeView
    },
    {
      path: '/history',
      name: 'history',
      component: HistoryView
    },
    {
      path: '/traditional',
      name: 'traditional',
      component: TraditionalView
    },
    {
      path: '/traditionalDetail',
      name: 'traditionalDetail',
      component: TraditionalDetail
    },
    {
      path: '/temple',
      name: 'temple',
      component: TempleView
    },
    {
      path: '/templeDetail/:id',
      name: 'templeDetail',
      component: TempleDetail
    },
    {
      path: '/natural',
      name: 'natural',
      component: NaturalView
    },
    {
      path: '/naturalDetail/:id',
      name: 'naturalDetail',
      component: NaturalDetail
    },
    {
      path: '/heritageView',
      name: 'heritageView',
      component: HeritageView
